import React from 'react';
import "./slider.css"
import '../../App.css';



function Slider() {
    const show=()=>{
        document.getElementsByClassName('slider_content').classList.toggle('active');
    }
    return (
        <div>
            <div id="slider">
                <div class="container">
                    <div class="slider_content">
                        <div class="toggle_btn" onClick={show}><span>Миссия</span></div>
                       <div></div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Slider;
